import Jumbotron from 'react-bootstrap/Jumbotron';
import {RENDER_URL} from '../../Utils/Urls';

const AreaComponent = () => {
    return (
        <div className = "content-data">
            <h4>Serve Families </h4>
                <p>
                    <span className="btn btn-secondary">
                          Food Pantry
                    </span>
                    <span className="btn btn-secondary">                       
                           Holiday Basket
                    </span>
                </p>
        </div>
    )
};

export default AreaComponent ;
